IMPORTANT: This is a template workflow file.

To use this workflow:
1. Download your actual workflow from n8n
2. Run: python3 sanitize_workflow.py workflow-original.json workflow.json
3. Review the sanitized file
4. Commit to GitHub

The actual workflow has 60+ nodes and is too large to include directly.
Please export from your n8n instance and use the sanitize script.

Key placeholders to replace:
- {{N8N_BASE_URL}}
- {{MCP_ENDPOINT_URL}}
- {{GOOGLE_DRIVE_FOLDER_ID}}
- {{DATA_TABLE_MAIN_ID}}
- {{DATA_TABLE_DOCUMENT_ID}}
- {{WEBHOOK_ID}}
- {{TIMEZONE}}
